/*

Create a function that follows the "ABACABADABACABA" rule up to a certain letter.

The abacabadabacaba pattern is where you start with the first letter (a), and with each new letter, you add the letter in the middle and the others at the start and end.

For instance:

A ➞ **A**
B ➞ A**B**A
C ➞ ABA**C**ABA
D ➞ ABACABA**D**ABACABA
E ➞ ABACABADABACABA**E**ABACABADABACABA
F ➞ ABACABADABACABAEABACABADABACABA**F**ABACABADABACABAEABACABADABACABA

# And so on ...

Examples

ABA("A") ➞ "A"

ABA("B") ➞ "ABA"

ABA("E") ➞ "ABACABADABACABAEABACABADABACABA"

Notes

N/A

*/

package main

import (
	"fmt"
)

func main() {
	assert(aba('A') == "A")
	assert(aba('B') == "ABA")
	assert(aba('C') == "ABACABA")
	assert(aba('D') == "ABACABADABACABA")
	assert(aba('E') == "ABACABADABACABAEABACABADABACABA")
	assert(aba('F') == "ABACABADABACABAEABACABADABACABAFABACABADABACABAEABACABADABACABA")
	assert(aba('G') == "ABACABADABACABAEABACABADABACABAFABACABADABACABAEABACABADABACABAGABACABADABACABAEABACABADABACABAFABACABADABACABAEABACABADABACABA")
	assert(aba('H') == "ABACABADABACABAEABACABADABACABAFABACABADABACABAEABACABADABACABAGABACABADABACABAEABACABADABACABAFABACABADABACABAEABACABADABACABAHABACABADABACABAEABACABADABACABAFABACABADABACABAEABACABADABACABAGABACABADABACABAEABACABADABACABAFABACABADABACABAEABACABADABACABA")
	assert(aba('I') == "")
	assert(aba('J') == "")
	assert(aba('K') == "")
	assert(aba('L') == "")
	assert(aba('M') == "")
	assert(aba('N') == "")
	assert(aba('O') == "")
}

func assert(x bool) {
	if !x {
		panic("assertion failed")
	}
}

var cache = make(map[rune]string)

func aba(r rune) string {
	if s := cache[r]; s != "" {
		return s
	}
	if !('A' <= r && r <= 'Z') {
		return ""
	}

	p := aba(r - 1)
	s := fmt.Sprintf("%s%c%s", p, r, p)
	cache[r] = s
	return s
}
